import React from 'react';
import { Link, NavLink, withRouter } from 'react-router-dom';

const TripDetailNavbar = props => {
  return (
    <div className='ui inverted menu'>
      <NavLink exact to={`/trips/${props.trip.id}/luggage`} activeClassName='active item' className='item'>
        <h3 className='ui header'>Luggage</h3>
      </NavLink>
      <NavLink exact to={`/trips/${props.trip.id}/flight-info`} activeClassName='active item' className='item'>
        <h3 className='ui header'>Flight Information</h3>
      </NavLink>
      <NavLink exact to={`/trips/${props.trip.id}/transportation`} activeClassName='active item' className='item'>
        <h3 className='ui header'>Transportation Information</h3>
      </NavLink>
      <NavLink exact to={`/trips/${props.trip.id}/arrival`} activeClassName='active item' className='item'>
        <h3 className='ui header'>Arrival</h3>
      </NavLink>
    </div>
  );
};

const TripDetailNavBarWithRouter = withRouter(TripDetailNavbar);

export default TripDetailNavBarWithRouter;
